import React from "react";
import "./index.css";

function HomePage() {
    return (<>
        <center className="mt-5">
            <div className="container-fluid">
                <h3 class="fs-1">Elevate <span className="fw-bold">Real Estate Success</span> with</h3>
                <h3 class="fs-1">Osumare's Digital Expertise</h3>
                <p>Tailored Solutions for Thriving in the Digital Real Estate Landscape</p>
               
                    <button class="d-grid col-2 mx-auto btn btn-primary rounded-pill" type="button">Get started</button>
            </div>
            <div>
                <img></img>
            </div>
        </center>

    </>);
}
export default HomePage;
